import './App.css';
import Header from "./Header/Header";
import Footer from "./Footer/Footer";
import Main from "./Main/Main";
import Nav from "./Nav/Nav";

const App = () => {
	return (
		<div className='app-wrapper'>
			<Header/>
			<div className='main_wrapper'>
				<Nav/>
				<Main/>
			</div>
			<Footer/>
		</div>
	)
}

export default App;
